==Trivia==
*There were a few tracks previously available in free-to-play before becoming [[members-only]]:
**[[Parade]] was accessible near [[Lumber Yard]] and [[Jolly Boar Inn]] until the [[Update:The Grand Exchange|release]] of [[Grand Exchange]] on [[26 February]] [[2015]].
**[[Legion]] and [[Gaol]] could be unlocked at [[Bandit Camp (Wilderness)|Bandit Camp]] and north of it, respectively, before an [[Update:Arceuus Spellbook Beta and A Kingdom Divided Preparation|update]] on [[28 April]] [[2021]].
**[[Getting Down to Business]] and [[Illusive]] could be unlocked during [[2021 Halloween event]].
*[[Egypt]] is currently the only free-to-play track unlockable exclusively by using Classic music area mode.

